import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar.js'
import { BrowserRouter,Routes,Route } from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Navbar/>
      <Routes>
        <Route path="/" element={<Home/>}></Route>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
